import{_ as t}from"./chunks/query-list.88b56485.js";import{_ as e}from"./chunks/chart-options.81bbd462.js";import{_ as o,c as s,o as i,a as r}from"./app.fe041d52.js";const a="/assets/create-new-query.e7e35bc7.png",q=JSON.parse('{"title":"Quick Start Guide","description":"","frontmatter":{},"headers":[{"level":2,"title":"Querying Data","slug":"querying-data"},{"level":2,"title":"Visualization Options","slug":"visualization-options"}],"relativePath":"getting-started/quick-start.md","lastUpdated":1704874839000}'),n={name:"getting-started/quick-start.md"},l=r('<h1 id="quick-start-guide" tabindex="-1">Quick Start Guide <a class="header-anchor" href="#quick-start-guide" aria-hidden="true">#</a></h1><p>Once you have set up your data sources, you can start querying your data from your data sources. Frappe Insights makes it very easy to query your data with its best-in-class query builder. You can then quickly create visualizations and dashboards from your queries.</p><p>To demonstrate the core features of Insights, we will be using the <strong>Demo Data</strong> that comes with Insights. This data is a sample dataset of an ecommerce store. It has multiple tables that contain data about the orders, customers, products, etc. We will be using the <strong>Orders</strong> table for this guide.</p><h2 id="querying-data" tabindex="-1">Querying Data <a class="header-anchor" href="#querying-data" aria-hidden="true">#</a></h2><p>The query builder is the main interface for querying your data. It is available in the *<strong>*Query**</strong> tab in the sidebar.</p><p><img src="'+t+'" alt="Query List"><em>Query Builder</em></p><p>You can click on any existing query to edit it or click on the *<strong>*Create New Query**</strong> button to create a new query. Once you click on the *<strong>*Create New Query**</strong> button, you will have to select an interface to create the query. There are 4 types of interfaces available:</p><ul><li><strong>Visual Query Builder</strong> - This is the default interface for creating queries. It is a visual interface that allows you to create queries without writing any SQL.</li><li><strong>Native Query Builder</strong> - This interface allows you to write SQL queries directly. You can use this interface if you are familiar with SQL.</li><li><strong>Script Query Builder</strong> - This interface allows you to write Python scripts to create queries. You can use this interface if you are familiar with Python.</li><li><strong>Notebook Editor</strong> - This interface allows you to add different types of blocks to create queries or report. It is similar to Jupyter Notebooks.</li></ul><p><img src="'+a+'" alt="Create New Query"><em>Create New Query</em></p><p>We will be using the <strong>Visual Query Builder</strong> interface to create our query. Once you select the interface, you will be taken to the query builder.</p><p><img src="https://github.com/frappe/insights_docs/assets/25369014/aac7fe7c-9643-4531-975f-34dcabc29a56" alt="Empty Query Builder"></p><p>The query builder has 3 sections:</p><ul><li><strong>Build</strong>: The sidebar on the left is used to build the query. It has 3 sections: <ul><li><strong>Data</strong>: This section is used to select the data source and the table.</li><li><strong>Filter</strong>: This section is used to add filters to the query.</li><li><strong>Summarize</strong>: This section is used to select columns and perform aggregations on them.</li><li><strong>Transform</strong>: This section is used to perform transformations on the data, for example, pivot tables.</li></ul></li><li><strong>Chart</strong>: This section is used to display the visualization of the query.</li><li><strong>Result</strong>: This section is used to display the result of the query.</li></ul><p>To make a basic query to get the <em>total number of orders</em>, follow the steps below:</p><ol><li>Select the <strong>Demo Data</strong> data source from the <strong>Data Source</strong> dropdown.</li><li>Select the <strong>Orders</strong> table by clicking on the <strong>+</strong> icon next to the <strong>Data</strong> section.</li><li>Select the <strong>Orders Count</strong> column from the <strong>Columns</strong> section&#39;s <strong>+</strong> icon.</li><li>Click on <strong>Execute</strong> to execute the query.</li></ol><video autoplay loop muted><source src="https://github.com/frappe/insights_docs/assets/25369014/b2c9927e-dd75-44a7-b19a-02caef5b49a0" type="video/mp4"> ![Total Orders](https://github.com/frappe/insights_docs/assets/25369014/4b0b7832-ecdc-491a-bd75-b8161c77888f) </video><p>Now, let&#39;s add a dimension to the query to get the <em>total number of orders placed per month</em>.</p><ol><li>Select the <strong>Order Purchase Date</strong> column from the <strong>Columns</strong> section.</li><li>Also add a <strong>Filter</strong> to find only the orders that are delivered.</li></ol><video autoplay loop muted><source src="https://github.com/frappe/insights_docs/assets/25369014/19e75fe1-d4f2-4066-807c-f0999a29a7e7" type="video/mp4"> ![Delivered Orders per Month](https://github.com/frappe/insights_docs/assets/25369014/45d2b0da-e435-4af0-b36f-c76148e451db) </video><h2 id="visualization-options" tabindex="-1">Visualization Options <a class="header-anchor" href="#visualization-options" aria-hidden="true">#</a></h2><p>As you go on adding columns and filters to your query, Insights will automatically create a visualization for you. You can also select the visualization type from the <strong>Chart Type</strong> dropdown and to customize the visualization, switch to the <strong>Visualize</strong> tab.</p><p><img src="'+e+'" alt="Chart Options"></p><p>Once you are satisfied with the visualization, you can add it to a dashboard. Click on the <strong>Add to Dashboard</strong> button to add the visualization to a dashboard. To add this visualization you&#39;ll need to create a dashboard first.</p>',23),u=[l];function c(d,h,g,p,y,m){return i(),s("div",null,u)}const w=o(n,[["render",c]]);export{q as __pageData,w as default};
